import React from 'react';
import Routers from './router/Routers';
import { ToastContainer } from 'react-toastify';
import './App.css';

const App = () => {
  return (
    <div className="app">
        <div className="content">
          <Routers />
          <ToastContainer />;
        </div>
      </div>
  );
};

export default App;
